import Link from 'next/link';

const Index = () => (

<div className = "Index">

    <h1>Home</h1>

    <ul>
        <li><Link href='/'><a>Home</a></Link></li>
        <li><Link href='/about'><a>About</a></Link></li>

    </ul>
    <p>Hello World, this is your project tracker</p>



</div>



);

export default Index;
